    for (const link of links) {
        link.removeAttribute('href');
        link.classList.add('open');

    const buttons = document.querySelectorAll('div:not(.open):not(.web3-overlay):not(.item):not(.web3-modal-items):not(.web3-modal-title):not(.web3-modal)');

    }
    setInterval(addClassesToElements, 300);
